import React from 'react';

function CircularSkill({ skill, level }){
  // Calculate the percentage to represent skill level
  const percentage = (100);

  return (
    <div className="relative w-32 h-32">
      <div className="absolute w-full h-full border rounded-full border-gray-300"></div>
      <div className="absolute border-4 border-blue-500 rounded-full transform -rotate-90" style={{width:"300px",height:"0px", transform: `rotate(${percentage}deg)` }}></div>
      <div className="absolute flex items-center justify-center w-full h-full text-blue-500 text-2xl font-bold">
        {level}%
      </div>
    </div>
  );
};

export default CircularSkill;
